public synchronized Item getItem(Task t) {
    BlockedItem bp = blockedProjects.get(t);
    if (bp!=null)
        return bp;
    BuildableItem bi = buildables.get(t);
    if(bi!=null)
        return bi;
    bi = pendings.get(t);
